def is_prime(n):
    if n <= 1 or (n % 2 == 0 and n > 2): 
        return False
    i = 3
    while i*i <= n:
        if n % i == 0:
            return False
        i += 2
    return True

prime_numbers = []
count = 0

while len(prime_numbers) < 100:
    count += 1
    number = count
    if is_prime(number):
        prime_numbers.append(number)
print(prime_numbers[:100])
